import React from "react";
import ReactDOM from "react-dom";

function TodoItem(props) {
  const styles = {
    color: "green",
    fontSize: 44,
  };
  return (
    <div style={styles}>
      <input type="checkbox" />
      <p>{props.todos.text}</p>
    </div>
  );
}

export default TodoItem;
